Mongo get Distinct Value Pairs and a List of Values of a thrid attribute<p>I have the following problem:</p>
<p>I want to get the following information from a MongoDB using the Python driver:</p>
<ul>
<li>A list of two unique combinations of two attributes and a sublist of a third value with the attributes of the third value.</li>
</ul>
<p><strong>Input:</strong></p>
<pre><code>[
  { surname: &quot;Will&quot;, lastname: &quot;Smith&quot;, position:&quot;Actor&quot; },
  { surname: &quot;Michael&quot;, lastname: &quot;Jackson&quot;, position:&quot;Musican&quot; },
  { surname: &quot;Will&quot;, lastname: &quot;Smith&quot;, position:&quot;Musican&quot; },
  { surname: &quot;Alicia&quot;, lastname: &quot;Keys&quot;, position:&quot;Musican&quot; },
  { surname: &quot;Brad&quot;, lastname: &quot;Pitt&quot;, position:&quot;Actor&quot; }
];
</code></pre>
<p><strong>My actual Query:</strong></p>
<pre><code>result = client['coll']['db'].aggregate([
    {
        '$group': {
            '_id': {
                'surname': '$surname', 
                'lastname': '$lastname'
            }
        }
    }
])
</code></pre>
<p><strong>Output of my Query</strong></p>
<pre><code>[
  { surname: &quot;Will&quot;, lastname: &quot;Smith&quot;},
  { surname: &quot;Michael&quot;, lastname: &quot;Jackson&quot;},
  { surname: &quot;Alicia&quot;, lastname: &quot;Keys&quot;},
  { surname: &quot;Brad&quot;, lastname: &quot;Pitt&quot;}
]
</code></pre>
<p><strong>Desired Output:</strong></p>
<pre><code>[
  { surname: &quot;Will&quot;, lastname: &quot;Smith&quot;, position: {[&quot;actor&quot;,&quot;musican&quot;]}},
  { surname: &quot;Michael&quot;, lastname: &quot;Jackson&quot;, position:{[&quot;musican&quot;]}},
  { surname: &quot;Alicia&quot;, lastname: &quot;Keys&quot;, position:{[&quot;musican&quot;]}},
  { surname: &quot;Brad&quot;, lastname: &quot;Pitt&quot;, position:{[&quot;actor&quot;]}}
]
</code></pre>

