How to extract grouped results from array in $group stage and return as separate fields?<p>I'm running an aggregation query, and the $group stage is as follows</p>
<pre><code>$group:
      {
          _id: 
          { 
              year_month: { $dateToString: { &quot;date&quot;: &quot;$updated_at&quot;, &quot;format&quot;: &quot;%Y-%m&quot;  } } 
              ,client_name: &quot;$clients_docs.client_name&quot;
              ,client_label: &quot;$clients_docs.client_label&quot;
              ,client_code: &quot;$clients_docs.client_code&quot;
              ,client_country: &quot;$clients_docs.client_country&quot;
              ,base_curr: &quot;$clients_docs.client_base_currency&quot;
              ,inv_curr: &quot;$clients_docs.client_invoice_currency&quot; 
              ,dest_curr: &quot;$store.destination_currency&quot;                       
          }
          ,total_vol: { $sum: &quot;$USD_Value&quot; }
          ,total_tran: { $sum: 1 }
      }                 
</code></pre>
<p>It returns the correct results, and returns all the grouped results in the _id:{} array.</p>
<p>I now want to extract all those fields from the array and return them not within the array so I can more easily export the output to a spreadsheet.</p>
<p>I tried using this stage:</p>
<pre><code>{
     $project:
     {
         year_month: 1
         ,client_name: 1
         ,client_label: 1
         ,client_code: 1
         ,client_country: 1
         ,base_curr: 1
         ,inv_curr: 1         
         ,dest_curr: 1
         ,total_vol: 1
         ,total_tran : 1
     }
},
</code></pre>
<p>But that returned the same results as the $group stage:</p>
<pre><code>{
    &quot;_id&quot; : {
        &quot;year_month&quot; : &quot;2022-01&quot;,
        &quot;client_name&quot; : &quot;client A&quot;,
        &quot;client_label&quot; : &quot;client A&quot;,
        &quot;client_code&quot; : NumberInt(0000),
        &quot;client_country&quot; : &quot;TH&quot;,
        &quot;base_curr&quot; : &quot;USD&quot;,
        &quot;inv_curr&quot; : &quot;USD&quot;,
        &quot;dest_curr&quot; : &quot;HKD&quot;
    },
    &quot;total_vol&quot; : 100000,
    &quot;total_tran&quot; : 100.0
}
</code></pre>
<p>I want the &quot;year_month&quot; through &quot;dest_curr&quot; fields at the same level as the &quot;total_vol&quot; and &quot;total_tran&quot;, so that when the data is exported they all appear as separate columns (now it's all captured as one &quot;_id&quot; column, and a &quot;total_vol&quot; and &quot;total_tran&quot; column).  What's the best way to do this?</p>

