Extend Document class or & Document with Mongoose Schemas?<p>I am using NestJS to write some backend code and fetch objects from MongoDB. The examples they offer in <a href="https://docs.nestjs.com/techniques/mongodb#model-injection" rel="nofollow noreferrer">their documentation</a> create a class annotated with <code>@Schema()</code> and then concatenate it with their built-in mongoose <code>Document</code> class.</p>
<pre><code>@Schema()
export class Cat {
  @Prop()
  name: string;
}

export type CatDocument = Cat &amp; Document;

export const CatSchema = SchemaFactory.createForClass(Cat);
</code></pre>
<p>I have seen other examples where the class simply extends <code>Document</code>, which seems more robust and simple.</p>
<pre><code>export class Cat extends Document {
  @Prop()
  name: string;
}
</code></pre>
<p>Is there a difference between the two?</p>

