Localhost MongoDB Connection with Mongoose not working<p>I'm trying to connect to my MongoDB localhost but it just won't connect. What happens is when I go to <code>/admin</code>, it just keeps loading and I get no messages, no nothing in the logs. I have no idea why. This is my router file that uses the connection:</p>
<pre class="lang-js prettyprint-override"><code>const express = require('express');
const debug = require('debug')('app:adminRouter');
const mongoose = require('mongoose');
const users = require('../data/users.json');

const adminRouter = express.Router();

adminRouter.route('/').get((req, res) =&gt; {
    const url = &quot;mongodb://localhost:27017&quot;; // process.env.DBURL
    const dbName = &quot;workplace_incident_reporter&quot;;

    (async function mongo(){
        let client;
        try {
            client = await mongoose.connect(url, 
                { useNewUrlParser: true, useUnifiedTopology: true });
            debug('Connected to mongoDB');

            const db = client.db(dbName);

