<pre><code>db.collection1.aggregate([{
    $facet: {
        &quot;started&quot;:[...],
        &quot;completed&quot;:[...]
        }
    },
  ]).toArray()
</code></pre>
<p>and assume that started is an array of this  :</p>
<pre><code>interface Starts{
  supplier: string;
  publisher: string;
  partner: string;
  buyer: string;
  started_at: string;
  starts: number;
}
</code></pre>
