  publisher: string;
  partner: string;
  buyer: string;
  finished_at: string;
  completes: number;
  revenue: number;
}
</code></pre>
<p>you see some started tasks with certain <code>supplier</code>,<code>partner</code>,<code>buyer</code>,<code>publisher</code> might be actually completed and their completion info exist in completed array so the two need to merge and some might not( and I will not have finished_at,completes,revenue info for them and I would put null for these values) and also some <code>completed tasks</code> might not be related to any <code>started tasks</code>( and I will not have starts,started_at info for them and I would put null for these values)ergo the final result will look like an array of this:</p>
<pre><code>interface StartsCompletes{
  supplier: string;
  publisher: string;
  partner: string;
  buyer: string;
  started_at: string;
  finished_at: string;
  starts: number;
  completes: number;
  revenue: number;
}
</code></pre>
<p>well I can loop through the output of <code>facet</code> with JavaScript for-loops and make it happen but can I some how add another stage to my <code>aggregate</code> pipeline and do it with MongoDB?</p>

