(Mongoose) Failed to remove a TTL field<p>I have a authentication system where the user need to validate their email after creating an account, then the status of the account would change from Pending to Active.</p>
<p>I want to implement a feature that if a user does not validate their email within a time frame, the account will be deleted. I was able to get the delete part done by setting an expire field in the Schema:</p>
<pre><code>const userSchema = new mongoose.Schema&lt;IUser&gt;(
    {
        email: {
            type: String,
            required: true,
        },
        status: {
            type: String,
            default: &quot;Pending&quot;,
            required: true,
        },
        expiresAt: {
            type: Date,
            default: () =&gt; Date.now() + 30 * 1000,
            expires: 30
        }
    },
    {
        timestamps: true
    }
</code></pre>
<p>However, the expire counter seem to be still counting even I purposely deleted the <code>expiresAt</code> field, and the document still get deleted.</p>
<pre><code>const user = await User.findById(tokenId).exec();

user.status = 'Active';
user.expiresAt = undefined;
const updatedUser = await user.save();
</code></pre>
<p>I wonder is there a way to stop or remove the TTL feature entirely after validation?</p>

