<pre class="lang-json prettyprint-override"><code>{
  &quot;1&quot;: {
    &quot;type1&quot;: 1,
    &quot;type2&quot;: 2
  },
  &quot;2&quot;: {
    &quot;type1&quot;: 11,
    &quot;type2&quot;: 12
  }
}
// There can by multiple values at all levels, not just 2
</code></pre>
<p>Now I want to to query for all <code>type2</code> with a filter, conceptually:</p>
<pre><code>&quot;*.type2&quot; &gt; 10
</code></pre>
<p>And I want to return only one field as well, so that the result would look like that:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;10&quot;: {
    &quot;type2&quot;: 20
  },
  &quot;20&quot;: {
    &quot;type2&quot;: 25
  }
}
</code></pre>
<p>Is it possible to achieve in MongoDB with a single query?</p>

